using Com.Danliris.Service.Merchandiser.Lib.Helpers;
using System;
using System.Collections.Generic;
using System.Text;
using Xunit;

namespace Com.Danliris.Service.Merchandiser.Test.Helpers
{
  public  class Base64Test
    {
        [Fact]
        public void GetBase64File_Return_Success()
        {
            string sample = "any,caharater,encode";
            var result = Base64.GetBase64File(sample);
            Assert.NotNull(result);
            Assert.Equal("caharater,encode", result);

        }

        [Fact]
        public void GetBase64Type_Return_Success()
        {
            string sample = "";
            var result = Base64.GetBase64Type(sample);
            Assert.NotNull(result);
         
        }

    }
}
